  return (
    <div>
      <Nav />
      <main>
        <h1>Cursos</h1>
        <p>Lista de cursos oferecidos.</p>
        {/* Adicione aqui a lista de cursos ou conte√∫do adicional */}
      </main>
      <Footer />
    </div>
  );
};

export default HomePage;
